import groovy.json.JsonSlurper
import javax.xml.xpath.*
import javax.xml.parsers.DocumentBuilderFactory

def getResponse = context.expand( '${getAppointmentListAfterSave#Response}' )
def externalIdGenerated = context.expand( '${generaterandomid#result}' )
def categoryID = context.expand( '${getCategoryId#result}' )
def categoryName = context.expand( '${getCategoryName#result}' )
def name = context.expand( '${datagenerator#name}' )
def displayName = context.expand( '${datagenerator#displayName}' )
def description = context.expand( '${datagenerator#description}' )

def jsonSlurper = new JsonSlurper()
def list= jsonSlurper.parseText(getResponse)

for(int i=0;i<list.size();i++) {
	if(list.extAppointmentTypeId[i]==externalIdGenerated) {
		log.info list.extAppointmentTypeId[i]
		assert list.extAppointmentTypeId[i] == externalIdGenerated
		log.info list.id[i]
		log.info list.name[i]
		log.info list.categoryId[i]
		assert list.categoryId[i] == categoryID
		log.info list.categoryName[i]
		assert list.categoryName[i] == categoryName
		log.info list.message[i].EN
		log.info list.message[i].ES
	}
}

